export default {
  path: 'hello',
  label: 'Hello页面',
  child: [
    {
      path: 'list',
      label: 'Hello列表页',
      child: [
        {
          path: 'jasad',
          label: '我家',
        }
      ]
    }, {
      path: 'detail',
      label: 'Hello详情页',
    }
  ]
}
